import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Header from "./components/Header";
import HomePage from "./pages/HomePage";
import Footer from "./components/Footer";
import MensFashionPage from "./pages/MensFashionPage";


const App = () => {
  return (
    <Router>
      <Header />
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/mens-fashion" element={<MensFashionPage />} />
        <Route path="/womens" element={<h1>Women's Category</h1>} />
        <Route path="/kids" element={<h1>Kids Category</h1>} />
        <Route path="/electronics" element={<h1>Electronics Category</h1>} />
        <Route path="/about" element={<h1>About Us</h1>} />
      </Routes>
      <Footer />
    </Router>
  );
};

export default App;
